pragma solidity >=0.4.22 <0.7.0;
pragma experimental ABIEncoderV2;
import "./ownable.sol";

contract Hospital is ownable {
    uint256 public index;
    mapping(address => bool) isHospital;

    struct hospital {
        uint256 id;
        string hname;
        string haddress;
        string hcontact;
        address addr;
        bool isApproved;
    }
    mapping(address => hospital) hospitals;
    address[] public hospitalList;

    modifier onlyHospital() {
        require(isHospital[msg.sender]);
        _;
    }

    function addHospital(
        string memory _name,
        string memory _haddress,
        string memory _hcontract,
        address _addr
    ) public OnlyAdmin {
        require(!isHospital[_addr], "Already exists");
        hospitalList.push(_addr);
        index = index + 1;
        isHospital[_addr] = true;
        hospitals[_addr] = hospital(
            index,
            _name,
            _haddress,
            _hcontract,
            _addr,
            true
        );
    }

    function getHospitalbyId(uint256 _id)
        public
        view
        returns (
            uint256 id,
            string memory hname,
            string memory haddress,
            string memory hcontract,
            address addr,
            bool isApproved
        )
    {
        uint256 i = 0;
        for (; i < hospitalList.length; i++) {
            if (hospitals[hospitalList[i]].id == _id) {
                break;
            }
        }
        require(hospitals[hospitalList[i]].id == _id, "it doest exist");
        hospital memory tmp = hospitals[hospitalList[i]];
        return (
            tmp.id,
            tmp.hname,
            tmp.haddress,
            tmp.hcontact,
            tmp.addr,
            tmp.isApproved
        );
    }
}
